❗️Pentru Iași și pentru toată regiunea Moldovei, Guvernul Ciolacu realizează două mari proiecte de infrastructură rutieră, extrem de importante: autostrăzile A7 și A8. 

1) Autostrada „Moldovei” (A7): Ploiești – Pașcani – Suceava – Siret (440 kilometri) 

- toate cele 13 tronsoane ale porțiunii Ploiești – Pașcani (320 km) suntînșantier; 
- peste 130 de kilometri vor fi inaugurați chiar în acest an, restul până la Pașcanianulviitor; 
- stadiu avansat al documentației pe segmentele Pașcani – Suceava respectivSuceava – Siret; 
- în total sunt 8 miliarde de euro pentru A7, finanțareasigurată integral. 

2) Autostrada „Unirii” (A8): Ungheni – Iași – Tg. Mureș (308 kilometri) 

- capetele montane, peste 50 km, sunt în proiectare și execuție, finanțarea este asigurată prin PNRR, termenul de finalizare a șantierelorfiind 2026; 

- alte secțiuni din tronsonul montan au licitațiile de #proiectareșiexecuțielansate; 

- sectorul ieșean al autostrăzii A8 (Ungheni – Iași – Moțca) va fi scos la licitație până la sfârșitul acestui an. Acum câteva zile, indicatorii tehnico-economici ai tronsonului aferent județului Iași (88 km) au fost aprobați prinhotărâre de Guvern;

- constructorul ansamblului de poduri peste Prut de la Ungheni, parte din A8, a fost desemnat. Firma are la dispoziție doi ani pentru a realiza podurile, drumul de legătură cu A8 și punctul de frontieră cu Republica Moldova. Investiție de peste 150 milioane de lei din fonduri UE nerambursabile; 

- autostrada A8 va fi deschisă traficului pe segmente, pe măsură ce acestea vor fi finalizate. Până în 2030 se va circula integral, de la un capăt la celălalt. 

